import React, { useEffect, useState } from "react";
import { Tabs } from "antd";
import { useDispatch } from "react-redux";
import { layHeThongRapChieuAction } from "../../../redux/actions/layHeThongRapPhimAction";

const { TabPane } = Tabs;

export default function TabsPhim(props) {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(layHeThongRapChieuAction);
  }, []);
  return (
    <Tabs tabPosition={"left"} defaultActiveKey="0" className="mt-20">
      <TabPane
        tab={
          <img
            src="https://picsum.photos/200"
            className="rounded-full"
            width={60}
          />
        }
        key="1"
      >
        Content of Tab 1
      </TabPane>
      <TabPane
        tab={
          <img
            src="https://picsum.photos/200"
            className="rounded-full"
            width={60}
          />
        }
        key="2"
      >
        Content of Tab 2
      </TabPane>
      <TabPane
        tab={
          <img
            src="https://picsum.photos/200"
            className="rounded-full"
            width={60}
          />
        }
        key="3"
      >
        Content of Tab 3
      </TabPane>
    </Tabs>
  );
}
